#[inline]
pub fn finish_size_prefixed_RFB_buffer<'a, 'b, A: flatbuffers::Allocator + 'a>(fbb: &'b mut flatbuffers::FlatBufferBuilder<'a, A>, root: flatbuffers::WIPOffset<RFB<'a>>) {
  fbb.finish_size_prefixed(root, Some(RFB_IDENTIFIER));
}
